import React from 'react';
import { Container, Typography, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const dummyStats = [
  { shortcode: 'abc123', clicks: 58, original: 'https://youtube.com' },
  { shortcode: 'xyz789', clicks: 32, original: 'https://github.com' },
  { shortcode: 'learn', clicks: 21, original: 'https://openai.com' }
];

const StatsPage = () => {
  return (
    <Container sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        URL Click Statistics
      </Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Shortcode</TableCell>
              <TableCell>Original URL</TableCell>
              <TableCell>Click Count</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {dummyStats.map((row, index) => (
              <TableRow key={index}>
                <TableCell>{row.shortcode}</TableCell>
                <TableCell>
                  <a href={row.original} target="_blank" rel="noopener noreferrer">
                    {row.original}
                  </a>
                </TableCell>
                <TableCell>{row.clicks}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Container>
  );
};

export default StatsPage;
